import React from 'react';

export default function Image({ setPortfolio, img }) {
    return (
        <div id="bigimg_container">
            < img
                style={{
                    cursor: "url('https://img.icons8.com/ios/30/ffffff/delete-sign.png'), auto"
                }}
                onClick={() => {
                    set("portfolio")
                }}
                alt={img.alt}
                className="main-image"
                src={require(`./../assets/photos/${img.img}.png`)}
            />

        </div>
    )
}
